def count_bad_moods(N, M, a):
    # Create adjacency list for graph representation
    adj = [[] for _ in range(N + 1)]

    # Build the graph based on the given matrix
    for i in range(M):
        for j in range(i + 1, M):
            if a[i][j] != a[j][i]:
                adj[a[i][j]].append(a[j][i])
                adj[a[j][i]].append(a[i][j])

    # Initialize variables to keep track of bad mood pairs
    bad_mood_pairs = 0

    # Perform DFS to find cycles in the graph
    def dfs(node, visited, path):
        visited[node] = True
        path.append(node)

        for neighbor in adj[node]:
            if not visited[neighbor]:
                dfs(neighbor, visited, path)
            elif neighbor in path:
                # Found a cycle, increment bad mood pairs
                bad_mood_pairs += len(path) - path.index(neighbor)

    # Mark all nodes as unvisited
    visited = [False] * (N + 1)

    # Iterate through all nodes to find cycles
    for node in range(1, N + 1):
        if not visited[node]:
            dfs(node, visited, [])

    return bad_mood_pairs

